cooco0jhl7fcub23bg70	cp3qa7t48b8c66dbg9d0	7e9bc8ca841a00deed894ba8eb633cafae31396b	APP_STORE	{"Link": null, "Name": "MrsMike1993", "Email": null, "Picture": "https://clank.so/images/pictures/feedback-customer.png", "Reviews": null, "Location": null, "Verified": null}	All the features w/ ease of use!\nI’ve tried all the workout apps, and this one by far has had the best support, with the most features, but is still simple to use.  The Apple Watch integration updates simultaneously between the app and your watch in real time. Which makes it so much easier to record reps and sets. I didn’t think I would use the Apple Watch feature much but now I can’t imagine not using it.\n\nUsing, or setting up your own, routines is so simple compared to other apps I’ve used. You can do it on your device, or on a desktop PC. I’ve done both and it’s equally as effective and easy. \n\nIt does communicate and record to Apple Health and Fitness app, as long as you give it permission. This is where I have my only constructive feedback. If you pause your workout in the Hevy app (which is useful and frequently necessary) Apple’s Health app still thinks you’re working out and records workout minutes until you completely end your workout.  Fix that and it’s the perfect app!  (of course that could be an Apple ecosystem issue and have nothing to do with Hevy)	ENGLISH		1.32.2	{"Link": "https://apps.apple.com/us/app/id1458862350?see-all=reviews&review=id11176404050", "Media": null, "Votes": null, "Rating": 5, "Verified": null}	41105	2024-04-19 10:21:40+00	2024-04-30 10:46:26.440394+00	2024-04-30 10:46:28.528539+00	2024-05-01 11:35:42.307503+00
